If you want to start up with the same layout every time regardless of the state at last exit, you can specify an array of tabs and the window tree in each one: [layout]
style = "config" [[layout.tabs]]
split = [ { window = "#room1:example.org" }, { window = "#room2:example.org" }
] [[layout.tabs]]
split = [ { split = [ { window = "#room3:example.org" }, { window = "#room4:example.org" } ] }, { window = "@user:example.org" }
]
